    /**
     * @var string Css class prefix
     */
    public static $cssPrefix = 'mdi';


    /**
     * Return all icons classes.
     * @param bool $html [optional] Whether to render icons to html. Default is false
     * @return array
     */
    public static function getAllIcons($html = false)
    {
        $result = [];
        foreach ((new \ReflectionClass(get_class()))->getConstants() as $constant) {
            $key = static::$cssPrefix . ' ' . static::$cssPrefix . '-' . $constant;

            $result[$key] = ($html)
                ? static::icon($constant) . '&nbsp;&nbsp;' . $constant
                : $constant;
        }

        return $result;
    }


